import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="header">
        <header>
          <div>Main</div>
          <div>Servis</div>
          <div>For as</div>
          <div>Contact</div>
        </header>
      </div>
    );
  }
}
export default App;
